import React from 'react';

function Box3(props) {
    return (
        <div className='Box3'>
            <div className='Box3-Title'>
                <h2>
                    {props.title}
                </h2>
            </div>
            <div className='Box3-Content'>

            </div>
        </div>
    );
}

export default Box3;
